import classes from "./Header.module.css"

const Header = () => {
  return (
    <div className={classes.header}>
      <div className={classes.title}>
        <h2>ReactMeals</h2>
      </div>
      <div>
        <button>
          Your Cart <span>2</span>
        </button>
      </div>
    </div>
  );
};

export default Header;
